import Bird from "./Bird";
import {useState} from "react";
import Empty from "./Empty";
import Tree_1 from "./Tree_1";
import Tree_2 from "./Tree_2";


function ObjectCreatorBird({objectIndex}) {
    const componentMap={
        empty: {
            min: 301,
            max: 1199,
            component: Empty
        },
        bird:{
            min: 4,
            max: 150,
            component: Bird
        }
    }
    for (const key in componentMap) {
        const {min, max, component} = componentMap[key];
        if (objectIndex >= min && objectIndex <= max) {
            return component;
        }
    }
}

export default ObjectCreatorBird;
